import React from "react";
import { useState, useRef } from "react";
import Card from "react-bootstrap/Card";
import Image from "react-bootstrap/Image";
import { Link } from "react-router-dom";
import Overlay from "react-bootstrap/Overlay";
import Tooltip from "react-bootstrap/Tooltip";
import "../styles/AboutMe.css";

export default function AboutMe() {
  const [show, setShow] = useState(false);
  const target = useRef(null);
  return (
    // <div id="aboutMe" className="d-flex flex-row">
    //   {/* title and picture */}
    //   <div className="d-flex flex-column w-50">
    //     {/* title */}
    //     <div>
    //       <h1>About Me</h1>
    //     </div>
    //     {/* picture */}
    //     <div>
    //       <img
    //         src="../../IMG_5699.JPG"
    //         alt="Author with graduation cap"

    //       ></img>
    //     </div>
    //   </div>
    //   {/* actual info */}
    //   <div className="w-50">
    //     <p>
    //       My name is Nya Tyus and I am a current student in the Georgia Tech
    //       Full Stack Coding Bootcamp. As a student, I have learned various tools
    //       and programming languages. To name a few, I have experience with
    //       MySQL, NoSQL, Express.js, Node.js, object oriented programming, React,
    //       and more! I have worked on a total of 3 group projects where we learn
    //       to collarboate, communicate, brainstorm, and use Git. In my free time,
    //       I like to travel, read, record and edit YouTube and TikTok videos, and
    //       cook. I also love the color pink as you can see!
    //     </p>
    //   </div>
    // </div>
    <div>
      <Card className="contact-card-bg">
        <Card.Body className="p-2">
          <Link to="/" className="contact-text">
            <Card.Subtitle className="mb-2">&#60; Home</Card.Subtitle>
          </Link>
          <Image
            className="mx-auto d-block headshotImg"
            src="../images/headshot.png"
            alt=""
            roundedCircle
          />
          <Card.Title className="text-center">Nya Tyus ü©∑</Card.Title>
          <Card.Subtitle className="text-center text-muted mb-2">
            "Tinker Bell of the tech world"
          </Card.Subtitle>
          <div className="d-flex flex-row justify-content-around text-center">
            <Card className="m-0 p-1 contact-text" style={{ width: "5rem" }}>
              <Card.Title className="m-0 p-0">‚úâÔ∏è</Card.Title>
              <Link to="mailto:nyastyus@gmail.com" className="contact-text">
                <Card.Text>email</Card.Text>
              </Link>
            </Card>
            <Card className="m-0 p-1 contact-text" style={{ width: "5rem" }}>
              <Card.Title className="m-0 p-0">üîó</Card.Title>
              <Link
                to="https://www.linkedin.com/in/nyatyus/"
                target="_blank"
                rel="noopener noreferrer"
                className="contact-text"
              >
                <Card.Text>connect</Card.Text>
              </Link>
            </Card>
            <Card className="m-0 p-1 contact-text" style={{ width: "5rem" }}>
              <Card.Title className="m-0 p-0">üíª</Card.Title>
              <Link
                to="https://github.com/nyashanice"
                target="_blank"
                rel="noopener noreferrer"
                className="contact-text"
              >
                <Card.Text>follow</Card.Text>
              </Link>
            </Card>
          </div>
          <div className="contact-div m-1 mb-2 mt-2">
            <p className="m-0 p-0">tech stack</p>
            <p className="m-0 p-0 contact-text">MERN, MySQL, JavaScript</p>
          </div>
          <div className="contact-div m-1 mb-2 mt-2">
            <p className="m-0 p-0">interests</p>
            <p className="m-0 p-0 contact-text">cooking, reading, traveling</p>
          </div>
          <div className="contact-div m-1 contact-text">
            <Link to="mailto:nyastyus@gmail.com" className="contact-text">
              <div className="p-2 contact-list-group">Send Message</div>
            </Link>
            <div
              ref={target}
              onClick={() =>
                navigator.clipboard.writeText("http://localhost:3000") &&
                setShow(!show)
              }
              className="p-2 contact-list-group"
            >
              Share Contact
            </div>
            <Overlay target={target.current} show={show} placement="top">
              {(props) => (
                <Tooltip id="overlay-example" {...props}>
                  Link copied to clipboard!
                </Tooltip>
              )}
            </Overlay>
            <div className="p-2">Add to Favorites</div>
          </div>
        </Card.Body>
      </Card>
      <div className="w-50">
        <p>
          My name is Nya Tyus and I am a graduate of the Georgia Tech Full Stack
          Coding Bootcamp as of March 2023. As a student, I learned various
          tools and programming languages. To name a few, I have experience with
          MERN stack (MongoDB, Express.js, React, Node.js), MySQL, object
          oriented programming, and more! During bootcamp, I worked on a total of 3 group
          projects where we learn to collarboate, communicate, brainstorm, and
          use Git. In my free time, I like to travel, read, record and edit
          YouTube and TikTok videos, and cook. I also love the color pink as you
          can see!
        </p>
      </div>
    </div>
  );
}
